def verify_NCT_circuit(n, m, width, seq, outputs_ANF, name):
    # generate QASM format quantum circuit and verify
    Q = [BV(f"X{i}") for i in range(n)] + [0 for i in range(width - n)]
    for oper in seq:
        if len(oper) == 1:
            i = oper[0]
            Q[i] += 1
        elif len(oper) == 2:
            i, j = oper 
            Q[j] += Q[i]
        else:
            i, j, k = oper 
            Q[k] += Q[i] * Q[j]

    print(f"##### verify {name} NCT circuit #####")
    print([outputs_ANF[i] in Q for i in range(m)])
  
